	public int lengthOfLongestSubstring(String str) {
		int len = str.length();
		for(int i=countOfChar(str);i>0;i--)	{
			for(int j=0;j<=(len-i);j++)	{
				String sub = str.substring(j, j+i);
				if(!isRepeat(sub))	{
					return i;
				}
			}
		}
        return 0;
    }
	private static int countOfChar(String s)  {
		Set<Character> set = new HashSet<Character>();
		for(int i=0;i<s.length();i++)	{
			set.add(s.charAt(i));
		}
		return set.size();
	}
    private static boolean isRepeat(String s)  {
        byte[] b = new byte[256];
        for(int i=0;i<s.length();i++)	{
        	int index = s.charAt(i);
        	if(b[index] == 1)	{
        		return true;
        	} else {
        		b[index] = 1;
        	}
        }
        return false;
    }
